pragma solidity ^0.8.17;
import "./EllipticCurve.sol";
import "./EllipticCurveFastMult.sol";


contract zkp{
    uint256 public constant GX = 0x79BE667EF9DCBBAC55A06295CE870B07029BFCDB2DCE28D959F2815B16F81798;
    uint256 public constant GY = 0x483ADA7726A3C4655DA4FBFC0E1108A8FD17B448A68554199C47D08FFB10D4B8;
    uint256 public constant AA = 0;
    uint256 public constant BB = 7;
    uint256 public constant PP = 0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFEFFFFFC2F;

    function Prover(uint256 x) public pure returns (uint256, uint256, uint256){
            uint256 r = uint256(keccak256("wow"));
            (uint256 hx,uint256 hy) = EllipticCurve.ecMul(x, GX, GY, AA, PP);
            (uint256 ux,uint256 uy) = EllipticCurve.ecMul(r, GX, GY, AA, PP);
            bytes32 c = sha256(abi.encodePacked(GX,GY,hx,hy,ux,uy));


    }

}
